class Solution {
    func minimumSeconds(_ nums: [Int]) -> Int {
        var count = 0
        var visited = Array(repeating: false, count: nums.count)
        for i in 0..<nums.count where !visited[i] {
            var current = i
            var cycleSize = 0
            while !visited[current] {
                visited[current] = true
                current = (current + 1) % nums.count
                cycleSize += 1
                if nums[current] == nums[i] {
                    count = max(count, (cycleSize + 1) / 2)
                    break
                }
            }
        }
        return count
    }
}
